import React from "react";
import theme from "../styles/theme";

const OtherProject = ({ project, description }) => (
  <div className="card">
    <h3>{project}</h3>
    <div className="body">
      <p>{description}</p>
    </div>

    <style jsx>
      {`
        .card {
          display: block;
          width: 180px;
          height: 250px;
          padding: 18px;
          border: solid 1px ${theme.colors.gray};
          margin-right: 15px;
          margin-bottom: 15px;
          border-radius: 5px;
          background-color: white;
        }
        .body {
          display: flex;
          height: 100%;
          align-items: flex-end;
          background-color: yellow;
          text-align: right;
        }
        p {
          color: ${theme.colors.black};
          width: 100%;
        }
      `}
    </style>
  </div>
);

export default OtherProject;
